    public  BufferedImage loadImage(String name) {
        try {
           BufferedImage image = ImageIO.read(getClass().getResource("/" +name +".png"));
           return image;// Load image from resources
        } catch (IOException e) {
            e.printStackTrace();
        }
		return null;
    }
